column8:
小枝の上にちょこんとのった金属のカッコウ鳥がとっても可愛い壁掛けフック<br>
鳥の部分が滑り止めになって、帽子なども落ちにくい。<br>
いくつか取り付ければ、ナチュラル感たっぷりの楽しいお部屋に仕上がります★<br>
<br>
※背面に壁掛用金具付 (石こうボード用アンカーボルトとネジ付)<br>
<br>
<B>【　仕　様　】</B><br>
カラー：ナチュラル<br>
素材：天然木、アイアン<br>
サイズ：w50 d120 h80mm<br>
<br>

<br>
メーカー希望小売価格はメーカーサイトに基づいて掲載しています
<br>
<IMG src="https://image.rakuten.co.jp/fullscoopmall/cabinet/99_evidence/evidence_wkw216na.jpg">
